import React from 'react';
import Mo from './Main.module.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMagnifyingGlass } from '@fortawesome/free-regu-svg-icons';

function Main() {
  return (
    <div className={Mo.main1}>
        <input type='text' className={Mo.inp1} placeholder='Search ToDo here.'><FontAwesomeIcon icon={faMagnifyingGlass} /></input>
    </div>
  )
}

export default Main;
